- input: TEXT,"F3A","","After review of our records of the October Quarterly Report
    our committee has fixed all errors that were poited out by the FEC.  It appears
    that there were not inappropriate contributions received but rather that the designation
    of the funds was improperly selected in our database.  The selection of other
    was not what was intended.  The individuals and organizations on the error list
    were contibutors to our committee and gave contributions in the general as part
    of debt retirement.  All appropriate action has been taken to correct these mistakes.  If
    there are further problems there will not be any hesitation to correct them."
